import React from 'react';
import Nav1 from './components/Nav.js'
import Sec1 from './components/Sec1.js'
import Sec2 from './components/Sec2.js'
import TopSM from './components/TopSM.js'
import MMenu1 from './components/MMenu.js'


function App() {
  return (
    <div className="App">
      	<header className="header_area">
        	<TopSM/>
        	<MMenu1/>
      	</header>
		<Sec1 />  
		<Sec2 />  

    </div>
  );
}

export default App;
